import { NavLink } from "react-router-dom";
import React, { useEffect, useState } from "react";
import './Nav.css';
import axios from "axios";
import { Nav, NavDropdown, Navbar, Container, Badge } from "react-bootstrap";
import {f} from '@fortawesome/react-fontawesome'
im
function Navigation() {
    // const [count, setcount] = useState([]);
    // useEffect(() => {
    //     axios.get("http://localhost:5000/doctor")
    //         .then(res => {
    //             setcount(res.data);
    //         });
    // }, [])
    // console.log(count);
    //#region NavLinkS
    function NavLinkDoctorsNotAppointment() {
        if (true) {
            return (
                <NavDropdown.Item as={NavLink} to="/doctor">Doctors Not Appointment<Badge pill bg="primary"></Badge></NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    function NavLinkDoctorsAppointment() {
        if (false) {
            return (
                <NavDropdown.Item as={NavLink} to="#action/3.2">Doctors Appointment</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    function NavLinkSignUp() {
        if (true) {
            return (
                <NavDropdown.Item as={NavLink} to="/signup">SignUp</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    function NavLinkSignIn() {
        if (true) {
            return (
                <NavDropdown.Item as={NavLink} to="/signin">SignIn</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    function NavLinkLogout() {
        if (false) {
            return (
                <NavDropdown.Item as={NavLink} to="/logout">SignIn</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    function NavLinkProfile() {
        if (false) {
            return (
                <NavDropdown.Item as={NavLink} to="/profile">SignIn</NavDropdown.Item>
            )
        }
        else {
            return (null)
        }
    }
    //#endregion
    return (
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Container>
                <Navbar.Brand>Care Center</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as={NavLink} to="/">Home</Nav.Link>
                        <NavDropdown title="Doctors" id="collasible-nav-dropdown">
                            {NavLinkDoctorsNotAppointment()}
                            {NavLinkDoctorsAppointment()}
                        </NavDropdown>
                        <NavDropdown title="Setting" id="collasible-nav-dropdown">
                            {NavLinkSignUp()}
                            {NavLinkSignIn()}
                            {NavLinkLogout()}
                            {NavLinkProfile()}
                        </NavDropdown>
                        <Nav.Link as={NavLink} to="/contact">Contact Us</Nav.Link>
                        <Badge className="Badge" bg="primary">Ahmed<Badge className="Badgepill" pill bg="success">.</Badge></Badge>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}
export default Navigation;
